import Image from '../Images/Beans.webp';

function BlogPost(props) {
    return (
        <div>
            {props.keyy}
            <h1>Title: {props.Post.Title}</h1> <br />
            Author: {props.Post.Username} <br />
            <img src={`data:image/jpeg;base64,${props.Post.Image}`} alt={props.Post.ImageName} /> <br />
            {props.Post.PostText} <br />
        </div>
    )
}

export default BlogPost;
